INSERT INTO `command` VALUES ('additem', 'Syntax: .additem #itemid/[#itemname]/#shift-click-item-link #itemcount\r\n\r\nAdds the specified number of items of id #itemid (or exact (!) name $itemname in brackets, or link created by shift-click at item in inventory or recipe) to your or selected character inventory. If #itemcount is omitted, only one item will be added.\r\n.');
INSERT INTO `command` VALUES ('additem set', 'Syntax: .additemset #itemsetid\r\n\r\nAdd items from itemset of id #itemsetid to your or selected character inventory. Will add by one example each item from itemset.');
INSERT INTO `command` VALUES ('ahbot', 'Syntax: ahbot $subcommand\n Type .ahbot to see a list of possible subcommands\n or .help ahbot $subcommand to see info on the subcommand.');
INSERT INTO `command` VALUES ('ahbot items', 'Syntax: .ahbot items $GrayItems $WhiteItems $GreenItems $BlueItems $PurpleItems $OrangeItems $YellowItems\r\n\r\nSet amount of each items color be selled on auction.');
INSERT INTO `command` VALUES ('ahbot items blue', 'Syntax: .ahbot items blue $BlueItems\r\n\r\nSet amount of Blue color items be selled on auction.');
INSERT INTO `command` VALUES ('ahbot items gray', 'Syntax: .ahbot items gray $GrayItems\r\n\r\nSet amount of Gray color items be selled on auction.');
INSERT INTO `command` VALUES ('ahbot items green', 'Syntax: .ahbot items green $GreenItems\r\n\r\nSet amount of Green color items be selled on auction.');
INSERT INTO `command` VALUES ('ahbot items orange', 'Syntax: .ahbot items orange $OrangeItems\r\n\r\nSet amount of Orange color items be selled on auction.');
INSERT INTO `command` VALUES ('ahbot items purple', 'Syntax: .ahbot items purple $PurpleItems\r\n\r\nSet amount of Purple color items be selled on auction.');
INSERT INTO `command` VALUES ('ahbot items white', 'Syntax: .ahbot items white $WhiteItems\r\n\r\nSet amount of White color items be selled on auction.');
INSERT INTO `command` VALUES ('ahbot items yellow', 'Syntax: .ahbot items yellow $YellowItems\r\n\r\nSet amount of Yellow color items be selled on auction.');
INSERT INTO `command` VALUES ('ahbot ratio', 'Syntax: .ahbot ratio $allianceratio $horderatio $neutralratio\r\n\r\nSet ratio of items in 3 auctions house.');
