INSERT INTO `command` VALUES ('event activelist', 'Syntax: .event activelist\r\nShow list of currently active events.');
INSERT INTO `command` VALUES ('event info', 'Syntax: .event info #event_id\r\nShow details about event with #event_id.');
INSERT INTO `command` VALUES ('event start', 'Syntax: .event start #event_id\r\nStart event #event_id. Set start time for event to current moment (change not saved in DB).');
